import { Title } from '../Components';

import './CSS/Predigtreihen.css'

export default function Predigtreihen(props){
    document.title = "FBG Bremen - Predigten";

    return (
        <>
            <Title title="Predigtreihen"/>

            {props.data !== undefined && <Playlists data={props.data.playlists}/>}
        </>
    );
}

function Playlists(props){
    return props.data.map((playlist) => { return <Playlist theme={playlist.theme} key={playlist.theme}/> });
}

function Playlist(props){
    return(
        <button>{props.theme}</button>
    );
}
